import Navigation from "../companents/navigation";
import Layout from "../companents/layout";
import Head from 'next/head'

function HomePage() {
  return (
    <Layout>
        <Head>
            <title>Anasayfa</title>
        </Head>
      <h1>Anasayfaya</h1>
      
      <style jsx>{`
        p {
          color: blue;
        }
        div {
          background: red;
        }
        @media (max-width: 600px) {
          div {
            background: blue;
          }
        }
      `}</style>
    </Layout>
  );
}

export default HomePage;
